INSERT INTO `product` VALUES (3, 'Johnson Baby Powder', 4, 'แป้งฝุ่นบริสุทธิ์ ไม่ก่อให้เกิดสิว เหมาะสำหรับผิวทุกประเภท แป้งฝุ่นเนื้อสีขาว นุ่มเนียน จากญี่ปุ่นไม่มีสี ควบคุมความมันได้ดี ไม่ก่อให้เกิดสิว แป้งคุณภาพดีเยี่ยมจากญี่ปุ่น  Johnson''s Baby Powder แป้งขาวที่สร้างเสน่ห์ให้กับสาวๆ ได้ไม่น้อยเลย เพราะนอกจะให้ความแห้งสบายแล้ว ยังทำให้มีกลิ่นตัวที่หอมชวนให้สัมผัสอีกด้วย มีเสียงจากชายหนุ่มว่า เวลาที่เดินผ่านสาวๆ ที่มีกลิ่นตัวเหมือนกลิ่นแป้งเด็ก สามารถทำให้หนุ่มๆ ใจละลายกันเลยทีเดียว  เรื่องของกลิ่นตัวหอมจากแป้งเด็กนั้นเป็นเคล็ดลับเล็กๆ น้อยๆ ที่จะทำให้สา', '290', 1, , 79);
INSERT INTO `product` VALUES (4, 'Music Flower 5 Color', 5, 'คุณสมบัติ  Condo Blush 7 Floors เนื้อแมท เม็ดสีแน่นมาก ติดทนตั้งแต่เช้ายันค่ำ ไม่ต้องเติม ระหว่างวัน ใครชอบฉ่ำๆ ปัดไฮไลท์ทับเริ่ด ด้วยดีไซน์ที่เก๋ไก๋น่าใช้ และคุณภาพเม็ดสี ที่แน่นมากๆ คุ้มสุดๆ 1 ชิ้น ได้ถึง 5 สี ใช้ได้นานถึง 2 ปี มันคือบลัชออนคอนโดเนื้อแมท ติดทนตั้งแต่เช้ายันค่ำ ไม่ต้องเติมระหว่างวันเลย ที่สำคัญไม่ก่อให้เกิดอาการแพ้  สีที่สาวๆ ชอบกันคือ สีชมพูนม, ส้ม และสีนู้ด ชั้นล่างสุดก็สวยเริ่ดมากๆ Music Flower 5-color Blusher 1 ชิ้น ประกอบด้วย 7 ชั้น ชั้นแรกเป็นกระจก + ต่อมาบลัชออน 5 ชั้น +', '278', 5, , 97);
INSERT INTO `product` VALUES (2, 'Laura Mercier Loose Setting Powder', 6, 'Laura Mercier Loose Setting Powder Translucent แป้ง ลอร่า ทรานลูเซ้น แป้งฝุ่นขายดีอันดับ 1 ในหลายประเทศทั่วโลก  Laura Mercier สร้างสรรค์นวัตกรรมใหม่ เพื่อผิวหน้าเนียนใสได้อย่างเป็นธรรมชาติ ด้วยแป้งฝุ่นเนื้อโปร่งใสที่ไม่เพิ่มสีให้กับใบหน้า  สามารถเติมแป้งได้ตลอดทั้งวันโดยที่ไม่รู้สึกว่าหนาหรือหนักจนเกินไป อีกทั้งยังไม่ทำให้ Make up เลอะเทอะหรือเปลี่ยนสีอีกด้วย  Laura Mercier Translucent Loose Setting Powder โดดเด่นด้วยแป้งอณูเล็กละเอียดที่สุด  ด้วยส่วนผสมพิเศษอย่าง French Cashmere Talc ให้สัมผัสท', '1590', 1, , 97);
INSERT INTO `product` VALUES (5, 'MERREZ''CA MINERAL PEARLS', 7, 'Wet n Wild MegaGlo Dual-Ended Contour Stick - Light/Medium  คอนทัวร์พร้อมไฮไลท์แบบแท่ง ที่ถูกออกแบบมาเป็นพิเศษทั้งคอนทัวร์ใบหน้าและไฮไลท์ในหนึ่งเดียว เนื้อนุ่มลื่นเกลี่ยง่าย ช่วยแก้ไขอำพรางรูปหน้าให้เรียวเล็กและสร้างมิติให้กับใบหน้า พร้อมกับเพิ่มประกายสว่าง บนโหนกแก้ม สันจมูกและหัวตา', '319', 5, , 99);
INSERT INTO `product` VALUES (6, 'Wet n Wild MegaGlo Dual', 8, 'Wet n Wild MegaGlo Dual-Ended Contour Stick - Light/Medium  คอนทัวร์พร้อมไฮไลท์แบบแท่ง ที่ถูกออกแบบมาเป็นพิเศษทั้งคอนทัวร์ใบหน้าและไฮไลท์ในหนึ่งเดียว เนื้อนุ่มลื่นเกลี่ยง่าย ช่วยแก้ไขอำพรางรูปหน้าให้เรียวเล็กและสร้างมิติให้กับใบหน้า พร้อมกับเพิ่มประกายสว่าง บนโหนกแก้ม สันจมูกและหัวตา', '349', 8, , 120);
INSERT INTO `product` VALUES (7, 'Mat Fix Cushion', 9, 'หมาะสำหรับทุกสภาพผิว มีให้เลือก2เบอร์  No.21- ผิวขาว - ผิวเหลือง No.23- ผิวเหลือง - ผิวสองสี  ปริมาณสุทธิ : 15 กรัม  สรรพคุณ : อำพรางรูขุมขนได้เรียบเนียนเป็นธรรมชาติ ปกป้องแสงแดด SPF 35 PA+++ ควบคุมความมันระหว่างวันได้ดี ไม่ก่อให้เกิดสิว ไม่ทำให้หน้ามัน กันน้ำ กันเหงื่อติดทนนาน สีไม่ดรอประหว่างวัน  วิธีใช้ : ทาทั่วบริเวณใบหน้าคู่กับฟองน้ำ ทำให้หน้าเนียนสวย  คำเตือน : หากใช้แล้วเกิดอาการแพ้ ควรหยุดใช้และปรึกษาแพทย์ทันที', '590', 9, , 98);
INSERT INTO `product` VALUES (8, 'Babalah', 10, 'แป้งเค้กทูเวย์ เนื้อซิลิโคน เป็นแป้งผสมรองพื้นพรีเมี่ยมคุณภาพสูงจากยุโรป ด้วยส่วนผสม SPF20 ปกปิดจุดด่างดำ ริ้วรอย ติดทนนานตลอดทั้งวัน แน่น เนียนมาก ไม่เป็นคราบไหลขณะเหงื่ออก คุมมันได้เลิศ เพียงแค่ซับก็หน้าใสเหมือนเดิม โดยร้าน Cosmeii', '499', 1, , 200);
INSERT INTO `product` VALUES (9, 'Concealer Cover Stick', 1, '3CE MOOD RECIPE MATTE LIP COLOR #115 MUSS ลิปสติกเนื้อแมทโทนสีนู็ด ให้ลุคธรรมชาติแต่งได้ทุกโอกาส แนะนำสี #115, #116 สีที่ขายดีที่สุดของคอลเลคชั่นนี้ เม็ดสีแน่น ติดทน ไม่เป็นคราบหรือเป็นขุย ดีงามตรงที่แพ็คเกจเป็นสีเดียวกับลิปสติก ไม่ต้องเปิดสีดูให้ยุ่งยาก ***ขายดีตามมาประกบกับรุ่น Lily maymac***', '185', 8, , 99);
INSERT INTO `product` VALUES (10, '3CE Mood Recipe', 12, 'ลิปเนื้อแมท ในแพคเกจทรงสี่เหลี่ยมคลาสสิกของ 3CE แต่พิเศษด้วยความที่เป็น Limited Edition จึงเปลี่ยนสีตัวแท่งไปตามเฉดสีของลิปกันเลย มีทั้งหมด 5 เฉดสี', '290', 2, , 100);
INSERT INTO `product` VALUES (11, 'Sivanna Colors Lip Liner', 11, 'ดินสอเขียนขอบปาก ลิปเนื้อแมท เนียนนุ่ม เกลี่ยง่าย เพิ่มลูกเล่นในการแต่งริมฝีปาก ที่เป็นทั้งลิปไลเนอร์และลิปสติกในแท่งเดียว', '275', 2, , 97);
INSERT INTO `product` VALUES (12, 'Kiss Beauty Liquid Matte', 13, 'ลิปสติกจิ้มจุ่มเนื้อแมทให้สีชัดเจน ไม่เป็นคราบระหว่างวัน มาพร้อมดินสอเขียนขอบปาก  เพื่อให้ปากดูเน้น ดูชัดขึ้น ไม่ทำให้ปากดำ  ลิปสติกจิ้มจุ่มเนื้อแมทให้สีชัดเจน ไม่เป็นคราบระหว่างวัน มาพร้อมดินสอเขียนขอบปาก', '599', 2, , 100);
INSERT INTO `product` VALUES (13, 'Huda Set Beauty Lipquid Matte ', 14, 'Huda Beauty Lipquid Matte Lipstick Set 16 Color 16 แท่ง 16 สี   ลิปจิ้มจุ่ม สีเนื้อแมทท์ รุ่นใหม่มาแบบเซ็ท 16 แท่ง 16 สี คุ้มมากกกกก ใช้ง่าย สีสวย ไม่ต้องทนกลืนลิปสติกลงท้องอีกต่อไป ทานน้ำสีไม่ติดหลอด ใช้เป็นรองพื้นปาก เมื่อสีลิปหลุดออก แล้วยังไม่มีเวลาเติมลิปสติกระหว่างวันทำงาน สำหรับคนที่ต้องการให้ปากสีสวย ติดทนนานทั้งวัน สวยใสธรรมชาติง่ายๆ ไม่ทำให้ริมฝีปากดำคล้ำ', '790', 2, , 100);
INSERT INTO `product` VALUES (14, 'Kailijumei Flower Jelly', 15, 'Flower Jelly Lip By Kailijumei ลิปเจลลี่ดอกไม้ ดอกไม้สีเขียว  ของแท้ 100% สินค้านำเข้าจากประเทศไต้หวัน  ลิปเจลลี่สีใส มีดอกไม้น่ารักอยู่ภายในลิป มีให้เลือก 4 สี สีแดง สีส้ม สีม่วง และสีเขียว ทาแล้วเปลี่ยนสี  ให้สีชมพูระเรื่อ และให้ความชุ่มชื้น มันวาว ติดทนนาน พร้อมบำรุงริมฝีปาก ไม่ให้ริมฝีปากแห้งแตก เป็น  ขุย และไม่ทำให้ปากคล้ำ     วิธีใช้ : ทาริมฝีปากได้ตามต้องการ', '257', 2, , 100);
INSERT INTO `product` VALUES (15, ' Kylie Birthday Edition Matte', 16, 'Kylie ลิปติกเนื้อแมท มี 6 สี  Birthday Edition matte liquid  Lipstick (6 COLOR) แถมฟรี อายไลเนอร์เขียนขอบตา สิเวียนา จำนวน1 แท่ง   ลิปสติกเนื้อลิควิดสุดฮิต สีสวยคมชัด เม็ดสีแน่น เนื้อบางเบา ทาแล้วแห้งเร็วเป็นเนื้อแมทแห้งสนิทติดริมฝีปาก สีติดทนนานตลอดวัน  สีสวย ใช้ง่าย ติดทนนาน พกพาสะดวก', '310', 2, , 100);
INSERT INTO `product` VALUES (16, '3CE Red Recipe Lip', 12, 'คอลเลคชั่นใหม่ล่าสุดจาก 3CE ลิปสติกเนื้อเนียนละเอียด เม็ดสีแน่น สีสด ชัดเจน ไม่ตกร่อง ติดทนนาน', '290', 2, , 100);
INSERT INTO `product` VALUES (17, 'Sleek Makeup Lip', 17, 'Sleek Lip 4 Lipstick Palette สี 857 Showgirl, palette ลิปสติกหลายเฉดสีในตลับเดียว เนื้อลิปที่สีติดทนนาน และชัดเจน', '520', 2, , 100);
INSERT INTO `product` VALUES (18, 'PRO MAKE UP PALETTE (DK212#02) ', 11, 'สีสันสวยจี๊ด ถูกใจจริงๆ สุดคุ่มค่า ขนาดไม่ใหญ่จนเกินไป พร้อมสวยไปกับคุณได้ทุกที่ พาเลทเดียวรวมครบความสวย ทั้ง ตาแก้มปาก พร้อมแปรงทาตา แปรงทาลิปสติก และดินสอเขียนขอบตาในพาเลทเดียวกัน  ในพาเลทประกอบด้วย อายแชโดว์ ทาตา 24 สี (มีชิมเมอร์) ลิปสติก จำนวน 6 เฉดสี บลัชออน-ปัดแก้ม 8 สี (เนื้อแมท และ เนื้อชิมเมอร์) แป้งอัดแข็ง 1 สี แปรงทาตา 1 ชิ้น แปรงทาลิปสติก 1 ชิ้น แปรงปัดแก้ม 2 ชิ้น ดินสอเขียนขอบตาสีดำ 1 แท่ง  พาเลทนี้คุ้มมาก ให้คุณมั่นใจในการแต่งหน้า ติดทน ติดหน้า ไม่ทำให้ระคายเคืองผิว', '241', 4, , 100);
INSERT INTO `product` VALUES (19, 'SIVANNA COLORS MAKEUP PALETTE No.02', 11, 'รวมครบความสวย ด้วย ชุดแต่งหน้า sivanna ที่จะตกแต่งใบหน้าให้คุณสวยไม่ซ้ำวัน มีทั้งแบบทาตา ทาปาก ปัดแก้ม และอื่นๆครบความสวย มีหลายหลายสี หลากหลายแบบที่ต้องการ สินค้าแบรนด์ที่ได้รับความนิยมมากที่สุด ให้คุณมั่นใจในการแต่งหน้า ทาแล้วติดทน ติดหน้า ไม่ทำให้ระคายเคืองผิว พร้อมที่จะสวยกับเรา เลือกชุดแต่งหน้า sivanna ได้เลย', '990', 4, , 100);
INSERT INTO `product` VALUES (20, 'Srichand Translucent Powder', 18, 'แป้งทาหน้า สำหรับผิวมัน และใช้ได้กับทุกโทนสีผิว   แป้งฝุ่นเนื้อละเอียดและบางเบา โปร่งแสง ทำให้ใช้ได้กับทุกโทนสีผิว ช่วยเซ็ทรองพื้นให้อยู่ตัว และไม่ทำให้สีรองพื้นเปลี่ยน พร้อมคุณสมบัติโดดเด่นในการควบคุมความมันอันเป็นเอกลักษณ์ของ ศรีจันทร์ พร้อมพัฟเนื้อดี และฝาหมุนที่เป็นสิทธิบัตรเฉพาะเหมาะแก่การพกพา   วิธีใช้   1.คุณสามารถลงแป้งฝุ่นได้ทันทีหลังจากรองพื้นเสร็จเรียบร้อยแล้วหรือจะลงแป้งฝุ่นหลังจากบำรุงผิวหน้าตามปกติเรียบร้อยแล้วเพื่อให้ได้ลุคแบบธรรมชาติ  2.เปิดฝาตลับแป้งศรีจันทร์ ทรานส์ลูเซนท์ พาวเด', '700', 1, , 100);
INSERT INTO `product` VALUES (21, 'Bifesta Cleansing Lotion ', 19, 'Bifesta Cleansing Lotion "Bright Up" 300 ml.  โลชั่นสูตรน้ำเช็ดเครื่องสำอางค์และทำความสะอาดผิว ที่สามารถเช็ดเครื่องสำอางค์ออกได้อย่างหมดจดและล้ำลึกถึงรูขุมขนในขั้นตอนเดียว ไม่ต้องถูหรือเช็ดหลายๆครั้งอันเป็นสาเหตุให้เกิดการระคายเคือง เพราะเพียงแค่เช็ดเบาๆด้วยสำลี เมคอัพก็หลุดออกอย่างง่ายดาย ไม่ต้องล้างออกด้วยโฟมหรือเจลใดๆ ช่วยให้ผิวกระจ่างใส ', '275', 7, , 100);
INSERT INTO `product` VALUES (22, 'Bioderma Sensibio H2O', 20, 'Product details of Bioderma Sensibio H2O ml. หัวปั๊มแบบใหม่ สีชมพู 500 ml.  เหมาะสำหรับผู้ที่มีผิวแพ้ง่าย จนถึงผิวแห้ง สามารถทำความสะอาดผิวหน้าและรอบดวงตา รวมไปถึงเครื่องสำอางได้อย่างสะอาดหมดจดและอ่อนโยน ส่วนผสมของผลิตภัณฑ์ไม่มีสี น้ำหอมและแอลกอฮอล์ ป้องกันอาการระคายเคืองจจาการทำความสะอาด และไม่เป็นอันตรายต่อผิวหนังรอบดวงตา ซึ่งผ่านการทดสอบโดยผู้เชี่ยวชาญทางจักษุวิทยา', '825', 7, , 100);
INSERT INTO `product` VALUES (23, 'MAYBELLINE NEW YORK EYE & LIP', 21, 'โลชั่นทำความสะอาดสูตรน้ำมันกึ่งน้ำ สำหรับเช็ดทำความสะอาดบริเวณริมฝีปากและรอบดวงตา คลีนหมดจดไม่ทิ้งคราบหมองแม้เครื่องสำอางกันน้ำ', '169', 7, , 100);
INSERT INTO `product` VALUES (24, 'Soft&Sexy Eyeshadow Collection', 11, 'Sivanna Colors อายแชโดว์ พาเลท ซีเวียน่า กล่องเหล็ก Soft&Sexy Eyeshadow Collection Precious Kit (เบอร์ 01)  มี 2 เบอร์ให้เลือก  คุณสมบัติ  พาเลทสวยหรู น่ารัก สุดคุ้ม อายแชโดว์ 14 เฉดสี + ไฮไลท์ 2 เฉดสี  อัพลุคให้สวยเลิศ สร้างมิติให้ดวงตาดูโดดเด่น ผลลัพธ์ดูเป็นธรรมชาติ  วิธีใช้ ใช้ทาตกแต่งเปลือกตาให้ดูสวยงามเป็นธรรมชาติ', '295', 3, , 96);
INSERT INTO `product` VALUES (1113, 'Classic EARTHTONE Eyeshadow palette ', 11, 'Sivanna colors อายแชโดว์ พาเลท Classic EARTHTONE Eyeshadow palette No.3  คุณสมบัติ  อายแชโดว์พาเลทสุด Cool จาก SIVANNA 12 สีสัน แนวเอิร์ธโทน เนื้อดี ติดทน สีสวย จับคู่สีได้ง่าย แต่งตาได้หลากหลากตามใจชอบ  อายแชโดว์เม็ดสีแน่น สีชัด ในพาเลทกล่องโลหะสุดคลาสสิค มี 4 เฉดสีให้เลือกสวย', '194', 3, , 100);
INSERT INTO `product` VALUES (1114, 'Music Flower 5 Colors Kit', 5, 'คุณสมบัติ  บลัชออนคอนโด สูง 7 ชั้น ชั้นแรกเป็นกระจก 5 ชั้น ต่อมาเป็นบรัชออน และชั้นสุดท้ายเป็นที่เก็บแปรง มีให้เลือกใช้ 5 สี เปิดใช้สะดวกสบาย เม็ดสีแน่น เป็นเนื้อแมต (ใครชอบฉ่ำๆ ปัดไฮไลท์ทับได้เลย) ติดทนตั้งแต่เช้ายันค่ำ ไม่ต้องเติมระหว่างวัน ที่สำคัญไม่ก่อให้เกิดอาการแพ้', '299', 5, , 100);
INSERT INTO `product` VALUES (1115, 'Kylie Cosmetics Kyshadow', 16, 'พาเลทตัวใหม่ล่าสุดจาก แบรนด์ kylie มาในโทนสีแดง ส้ม ทอง เหมือน ฤดูใบไม้เปลี่ยนสี พาเลทเนื้อฝุ่น มี 9 สี พาเลทนี้มีเนื้อชิมเมอร์ 4 สี ให้ประกายเบาๆ และอีก 5 สีเป็นเนื้อแมท สามารถใช้ด้วยกันเพื่อเบรกความหนักของสีได้ จะบอกว่าสวอชมาสวยทุกสี สามารถใช้เป็นสีเดี่ยวๆ ทาสีเดียวกรีดไลน์เนอร์แล้วออกไปแซ่บได้เลยทีเดียว หรือโทนเบาๆนวลๆ ใช้วันแต่งหน้าน้อยๆ ก็สวยผู้ดีสุดๆ หรือใครจะแมทน้ำตาลทองให้หรูไปอีก พาเลทเดียวสวยครบโดดเด่น', '2152', 3, , 100);
INSERT INTO `product` VALUES (1116, 'Huda Liquid Matte Lipstick (CHEERLEADER)', 14, 'Liquid Matte Lipstick ลิปสติกลิควิด เนื้อแมท เม็ดสีแน่น สีสวย กลบสีปากได้มิด ไม่ไหลเยิ้ม ติดทนนาน ไม่หลุดลอกง่าย แต่ล้างออกง่าย ไม่แห้งตึง และไม่แห้งเร็วเกินไป ดีไซด์สวยหรูคลาสสิค ใช้งานง่าย พกพาสะดวก   พร้อมทั้ง  Beauty Huda Lip Contour  ดินสอเขียนขอบปาก เนื้อแมทบางเบา ที่มีความเรียบละมุน และให้ความชุ่มชื้น เส้นคม สีสวยชัด  ติดทนนาน สวยชัดตลอดวัน พร้อมบำรุงริมฝีปาก ให้คุณแต่งแต้มและแก้ไขริมฝีปากให้สวยงามสะดุดตา (ใช้ได้กับกบเหลาดินสอทั่วไป เมื่อไส้ลิปสั้นลง)', '187', 2, , 100);
INSERT INTO `product` VALUES (1117, 'B Kill Cover Liqid Founwear Cushion', 11, 'คุณสมบัติ  ช่วยปกป้องผิวจากรังสียูวี และความแห้งกร้าน ไม่ลบเลือนง่าย ทำให้ผิวไม่มัน พร้อมปกป้องผิวเพือคงความงดงามเนิ่นนาน มอบสัมผัสสดชื่น และความรู้สึกชุ่มชื่น  มาพร้อมกับ รีฟิลในกล่อง 1 ชิ้น แป้งน้ำแร่ ขั้นเทพ บีบี แป้งน้ำแร่ SIVANNA BB Kill Cover Liqid Founwear Cushion แต่งหน้าได้เนียนเด้ง ไม่ต้องหลายขั้นตอน แค่ทาก็เสร็จกระบวนการแล้ว BB Kill Cover Liqid Founwear Cushion ตัวเดียว ทำให้การแต่งหน้าง่ายขึ้น ไม่ต้องลง Base/BB Cream/CC Cream หรือลงรองพื้นให้ยุ่งยาก ตัวเดียวครบ  BB Kill Cover Liqid F', '279', 9, , 100);
INSERT INTO `product` VALUES (1118, 'LIP TINT 01 PUNCH', 1, 'คุณสมบัติ เบื่อมั้ย...ลิป ทินท์ แบบเดิมๆ ที่สีเจือจางและทำให้ปากแห้ง? ครั้งแรก! ลิป ทินท์ ที่ดีที่สุดจากเมย์เบลลีน สีสันจัดจ้าน ให้ปากเซ็กซี่ เย้ายวน สีติดทนนาน บำรุงริมฝีปากชุ่มชื่นทั้งวัน   วิธีใช้ ทาลิปให้ทั่วปากด้วยหัวแปรง ห้ามเม้มปากหลังทา รอ 10 วินาทีเพื่อให้ได้สีสดชัด', '299', 2, , 100);
INSERT INTO `product` VALUES (1119, 'Flower Jelly Lipstick', 15, 'ลิปบำรุง เนื้อเจลลี่ เรียกว่าเป็นลิปดอกไม้แบบโกลด์ (รุ่นผสมทองคำ)  มีสี่สีดอกไม้ มีส่วนผสมของ coco butter และ botanical extracts  น้ำมันโอลีฟ สารสกัดจากน้ำมันเมล็ดองุ่น น้ำมันดอกลาเวนเดอร์  จึงให้กลิ่นหอมลาเวนเดอร์อ่อนๆ พร้อมใส่ดอกไม้จริงและทองคำเปลว ด้านใน ทองคำเปลวมีคุณสมบัติในการกระตุ้นการสร้างคอลลาเจน  จึงช่วยบำรุงให้ริมฝีปาก อวบอิ่ม เรียบเนียน สีติดทนานตลอดวัน ', '257', 2, , 100);
INSERT INTO `product` VALUES (1120, 'Lipstick Bright Surplus Dreamy Purple ', 15, 'ลิปสติกแบรนด์ดังหลบไป นาทีนี้ต้องมาทำความรู้จักกับแบรนด์ Kailijumei แบรนด์เครื่องสำอางจากทางฝั่งประเทศจีน เพราะงานนี้เขาไม่ได้มาเล่นๆ Kailijumei ออกลิปสติกเจลลี่ใสที่ด้านในมีดอกไม้จริงและเกล็ดทองคำอยู่  ดูหรูหราเลอค่า น่าใช้สุดๆ   ลิปบาล์มเปลี่ยนสี ที่มีส่วนผสมของทองคำเปลว สารสกัดจากน้ำมันมะกอกน้ำมันเมล็ดองุ่น และนำมันลาเวนเดอร์ช่วยบำรุงริมฝีปากให้ชุ่มชื้น พร้อมเพิ่มสีสันสดใสติดทนนาน 12 ชั่วโมง ', '420', 2, , 100);
INSERT INTO `product` VALUES (1121, 'Sleek Makeup Face Contour Kit', 17, 'เคล็ดลับการแต่งหน้าเฉดดิ้งและไฮไลท์ ถูกรวบรวมอยู่ในตลับเดียว เซทที่สมบูรณ์แบบนี้จะเผยผิวหน้างามพิสุทธิ์อย่างเป็นธรรมชาติ มอบโครงหน้าสวยงามมีมิติ และช่วยกระจายแสงสำหรับผิวหน้าสี Light เหมาะสำหรับผิวขาวถึงผิวเหลือง เฟคคอนทัว ที่มีสีแตกต่าง 2 สี 2 เนื้อสัมผัส สีไฮไลท์ที่มีเนื้อสีเงาระยับสีประกายทอง สำหรับไล้เพิ่มความเงาดูมีมิติขึ้น และเนื้อแมตสีบรอนซ์เข้ม บางใส เพื่อสร้างสรรค์มิติให้ผิวหน้าให้ผลลัพธ์อันสมบูรณ์แบบแด่พวงแก้มและใบหน้าพร้อมให้คุณสาวๆ เจิดจรัสในทุกมุมมองและทุกโอกาส', '550', 8, , 100);
INSERT INTO `product` VALUES (1127, 'Mineral BB Cream SPF30 PA++', 3, 'เวลคอสบีบี รุ่น Moisture Solution Mineral BB SPF30/PA++ บีบีครีมที่เป็นทั้ง whitening ลดริ้วรอย กันแดดด้วยค่าการปกป้อง SPF30 ช่วยบำรุงผิวให้ขาวขี้น นุ่มชุ่มชื้น ปกปิดริ้วรอย ควบคุมความมันได้ดีตลอดวัน ผิวหน้าขาว เนียนใส รุ่นนี้เป็นบีบีครีมที่เหล่าดารา นางแบบ ใช้เพื่อใบหน้าขาวใส เรียบเนียน หนึ่งเดียวทั้งปกปิดและบำรุง บีบีครีมที่เป็นทั้ง whitening บำรุงผิวให้ขาวขึ้น และเป็น wrinkle ช่วยลดริ้วรอย พร้อมกันแดดในตัว ข้ามขั้นตอนที่เสียเวลาไปได้เลย พร้อมรับประกันความเนียน สวยตลอดวัน Moisture Mineral BB บ', '350', 6, , 100);
INSERT INTO `product` VALUES (1126, 'Blemish Balm SPF30 PA++', 3, 'Welcos No Makeup Face Blemish balm Whitening SPF30 PA++ ขนาด50ml บีบีครีมขั้นเทพที่โด่งดังที่สุด ช่วยคุมมันดีเยี่ยม และติดทนนาน มีส่วนผสมของ EGF ลดริ้วรอยอย่างได้ผล สารสกัดจากดอกไม้ธรรมชาติ ช่วยบำรุงผิวนุ่มชุ่มชื่น ลดความมันและทำให้หน้าเรียบขึ้น ให้ผิวเนียน ผ่อง เด้ง ตั้งแต่เช้าจรดค่ำ มีส่วนผสมของสมุนไพร และชาเขียว ใช้ได้แม้ผิวแพ้ง่ายหรือเป็นสิว ทั้งยังมีสารป้องกันแสงแดดด้วยSPF30 PA++ สามารถใช้ได้กับทุกสภาพผิว และทุกสีผิว', '350', 6, , 100);
INSERT INTO `product` VALUES (1125, 'Lip Contour Set B', 14, 'ประกอบด้วย  Lip Contour Matte Pencil Liquid Matte Lipstick ดินสอเขียนขอบปาก คุณสมบัติ  สีสวย เนื้อแน่นติดทนนาน ไม่เป็นคราบ ไม่ติดหลอด ปากไม่ลอกไม่ทำให้เป็นขุย', '259', 2, , 100);
INSERT INTO `product` VALUES (1128, 'Change Blemish Balm SPF25 PA++', 3, 'มีส่วนผสมของสมุนไพร ช่วยบำรุงผิวหน้า Welcos Color Change BB - 50ml. มีส่วนผสมของสมุนไพร ชาเขียว ช่วยบำรุง ลดการอักเสบ พร้อมป้องกันการเกิดสิว ปรับสีผิวให้ขาวใส มีออร่า ด้วยส่วนผสมไวท์เทนนิ่ง ปรับผิวให้ขาวยิ่งขึ้น กันแดดสูงถึง 25 เท่า แถมยังควบคุมความมันได้อย่างสมบูรณ์แบบ มั่นใจได้ว่าหน้าของคุณจะสวยใสวิ้งไปตลอดวัน', '390', 6, , 100);
INSERT INTO `product` VALUES (1129, 'Srichand Luminescence Glowing Brilliance Perfecting Powder', 18, 'แป้งอัดแข็งผสมรองพื้นสูตรพิเศษ เนื้อละเอียดละมุน ช่วยมอบความเนียนนวลให้กับผิวหน้า พร้อมการปกปิดผิวระดับปานกลาง ช่วยให้ผิวของคุณแลดูเปล่งประกาย แป้งผสมรองพื้นสูตรควบคุมความมัน', '660', 1, , 100);
INSERT INTO `product` VALUES (1130, 'Snail Smooth Pore BB Cream SPF45/PA++', 7, 'สูตรเฉพาะตัวที่เนื้อครีมสามารถปรับสีเข้ากับสีผิวของผู้ใช้เองโดยจะทำให้ไม่เกิดการหน้าวอก หน้าเวอร์ หน้าลอย คอดำ และไม่ต้องคอยกังวลกับการเลือกสีบีบีครีมอีกต่อไป ที่สำคัญยังทำให้ผิวหน้าดูฉ่ำวาวดูผิวสุขภาพดีที่สุดเลยละ และยังสามารถป้องกันแสงแดดและไม่ดูดซับแสงแดดอีกด้วยพร้อมทั้งสะท้อนแสงแดดออกจากผิวทันทีไม่กักเก็บรังษี UV ไว้ให้หน้าหมอง หน้าคล้ำแน่นอน มีตัวช่วยแบบนี้แล้วก็ง่ายไปเลยสำหรับผิวหน้าที่เงาวาวมีกันแดด SPF45/PA+++', '490', 6, , 100);
INSERT INTO `product` VALUES (1131, 'Laura Mercier Foundation Primer', 6, 'Foundation Primer ทำหน้าที่เป็นเบสปรับสภาพผิว เนื้อใสบางเบา ไม่หนักหน้า ใช้ได้กับทุกสีผิว และผิวที่บอบบางแพ้ง่าย ซึมสู่ผิวได้อยางรวดเร็ว ทำหน้าที่ปกปิดอำพรางรูขุมขน ทำให้ผิวหน้าเรียบสมบูรณ์แบบ ช่วยให้แป้งและรองพื้นที่ทาตามหลังเกลี่ยได้ง่ายขึ้น และยึดติดผิวได้นานตลอดวันโดยไม่เป็นคราบในระหว่างวัน', '339', 6, , 100);
INSERT INTO `product` VALUES (1132, 'Laura Mercier Velour Lovers Lip', 6, '  Velour Lovers Lip Colour ลิปสติกเนื้อซาติน ที่จะให้คุณมีลุคแบบ Matte Finish ด้วยเนื้อสีที่เข้มข้น ช่วยให้ริมฝีปากเอิบอิ่ม เนื้อสีที่เด่นชัด ให้สีสันสวยสด มีชีวิตชีวา แม้ทาเพียงครั้งเดียว', '550', 2, , 100);
INSERT INTO `product` VALUES (1133, 'Laura Mercier Foundation Powder', 6, 'มั่นใจในคุณภาพสินค้ามีฉลาก สคบ.ภาษาไทย แสดงเลขที่ใบรับแจ้งนำเข้า, ผู้ผลิต,ผ้นำเข้า, ส่วนประกอบ แป้งผสมรองพื้นเนื้อเนียนสุดหรู สำหรับผิวขาวปานกลาง ปริมาณ 7.4 กรัม (ขนาดปกติ) พร้อมพัฟฟองน้ำและพัฟกำมะหยี่ เนื้อแป้งผสานเทคโนโลยีล่าสุดในการควบคุมความมัน ช่วยให้ผิวหน้าเรียบเนียน สดใส ได้ยาวนานตลอดวันโดยปราศจากความมันเงา พร้อมทั้งทำให้ช่วยปกปิดจุดบกพร่องของใบหน้าอย่างเป็นธรรมชาติ สามารถใช้ได้ทั้งแบบแห้งและแบบเปียกเพื่อการปกปิดที่สมบูรณ์แบบ', '1079', 1, , 99);
INSERT INTO `product` VALUES (1134, 'Babalah Matte Me Lip', 10, 'บาบาร่า แมท มี ลิปแม่มด สีสวยติดทนนานดั่งต้องมนต์ เสกให้ริมฝีปากสวย เอิบอิ่ม แวววาว น่าสัมผัส ด้วยเนื้อ Matte สุด Colorful มาแต้มบนริมฝีปากอันอ่อนนุ่มของคุณได้น่ารัก คุณภาพแน่นเกินราคา มีให้เลือกมากถึง 12 เฉดสี01 Coral Peach 02 Magnficanee 03 Mocha04 Casa Bonita05 Candy Stripe06 Bright Cherry07 Pink Passion08 Victorian Red09 Ink Berry10 Plum Jam11 Red Embrace12 Can Berry Zinc', '239', 2, , 100);
